CREATE TABLE `_temp` (
  `entry` mediumint(8) unsigned NOT NULL default '0',
  `BagFamily` mediumint(9) NOT NULL default '0',
  `GemProperties` mediumint(9) NOT NULL default '0',
  PRIMARY KEY  (`entry`,`BagFamily`,`GemProperties`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
update item_template set BagFamily=(select BagFamily from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
