CREATE TABLE `_temp` (
  `entry` mediumint(8) unsigned NOT NULL default '0',
  `stat_type1` tinyint(3) unsigned NOT NULL default '0',
  `stat_value1` smallint(6) NOT NULL default '0',
  `stat_type2` tinyint(3) unsigned NOT NULL default '0',
  `stat_value2` smallint(6) NOT NULL default '0',
  `stat_type3` tinyint(3) unsigned NOT NULL default '0',
  `stat_value3` smallint(6) NOT NULL default '0',
  `stat_type4` tinyint(3) unsigned NOT NULL default '0',
  `stat_value4` smallint(6) NOT NULL default '0',
  `stat_type5` tinyint(3) unsigned NOT NULL default '0',
  `stat_value5` smallint(6) NOT NULL default '0',
  PRIMARY KEY  (`entry`,`stat_type1`,`stat_value1`,`stat_type2`,`stat_value2`,`stat_type3`,`stat_value3`,`stat_type4`,`stat_value4`,`stat_type5`,`stat_value5`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
update item_template set stat_type1=(select stat_type1 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_value1=(select stat_value1 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_type2=(select stat_type2 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_value2=(select stat_value2 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_type3=(select stat_type3 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_value3=(select stat_value3 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_type4=(select stat_type4 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_value4=(select stat_value4 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_type5=(select stat_type5 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
update item_template set stat_value5=(select stat_value5 from _temp as old where old.entry=item_template.entry) where entry in (select entry from _temp);
DROP TABLE `_temp`;


