UPDATE `quest_template` SET `QuestFlags` = 131, `Details` = 'Okay, the crystal things...$B$BThe big-tongues use the crystals to power their rain shrines. Zepik not know quite how it works, but Zepik does know that if they use wrong crystals, the clouds and the rain go crazy!$B$BZepik tried to sneak in at one of their other rain shrines, but it not go so well. It sure to go much better with two!$B$BTake crystals, place at big stone pillar shrine thing, then smash them to release power. Zepik not sure what will happen, so might want to step back after.', `Objectives` = 'Zepik wants you to smash the Skyreach Crystal Clusters in front of the Mistwhisper weather shrine.$B$BIf you lose Zepik''s Hunting Horn, speak to Elder Harkek in Frenzyheart Hill.', `OfferRewardText` = 'It work so good!$B$BYou see lightning smash that oracle guy? So good!$B$B<Zepik rubs his hands together and chuckles maniacally.>', `ReqItemId1` = 38510, `ReqItemCount1` = 1, `ReqCreatureOrGOId1` = -300213, `ReqCreatureOrGOCount1` = 1, `ReqSpellCast1` = 51151, `RewRepValue1` = 1000 WHERE `entry` = 12537;
