UPDATE `quest_template` SET `QuestFlags` = 136, `Details` = 'Bristlepine and wasps are boring! Big-tongues the only thing fun to hunt.$B$BWhile we mess up rain shrine, we kill lots of mist big-tongues. That sure to make them not want to come back to village thing.$B$B<Zepik nods to himself confidently.>', `Objectives` = 'Zepik wants you to kill 12 Mistwhisper Gorlocs.$B$BIf you lose Zepik''s Hunting Horn, speak to Elder Harkek in Frenzyheart Hill.', `OfferRewardText` = 'I stab those big-tongues good.$B$BYou did okay I guess.$B$BNo, I just kidding! You good hunter. I glad to hunt with you.', `ReqCreatureOrGOId1` = 28109, `ReqCreatureOrGOCount1` = 12, `RewRepValue1` = 700 WHERE `entry` = 12538;
