UPDATE `quest_template` SET `QuestFlags` = 4, `NextQuestId` = 12540, `Details` = 'Okay, we done! Time to go back. No crocolisk to ride this time though.$B$BIf we go east and stay near ridge, it should lead all the way back near hill.$B$BNeed to be careful not to go far below ridge though or we might go right into big-tongue tree village thing. Zepik not think they like us right now.', `Objectives` = 'Find your way back to Frenzyheart Hill and speak to High-Shaman Rakjak.', `OfferRewardText` = 'Blown up by lightning?$B$B<Rakjak breaks out laughing for a moment.>$B$BYou good hunter. Rakjak like you. Maybe one day you can be honorary Frenzyheart!$B$BOnly maybe though!', `RewRepValue1` = 700, `RewSpell` = 54068 WHERE `entry` = 12539;
