UPDATE `quest_template` SET `QuestFlags` = 132, `NextQuestId` = 12545, `Details` = '$C! The Argent Crusade is looking for able bodied soldiers that are willing to set aside their differences and join forces to battle the forces of the Lich King. Will you take up our cause?$B$BShould you be interested, venture north to Light''s Trust and speak with Crusader Valus.$B$BYou will find Light''s Trust amidst the ruins of the sacked troll city of Jintha''kalar - bordering Zul''Drak.$B$BFarewell.', `Objectives` = 'Report to Crusader Valus at Light''s Trust in Dragonblight.', `OfferRewardText` = 'Mere footsteps from here lies the Drakkari empire.$B$B<Valus points east.>$B$BFor thousands of years the Drakkari remained isolated, preferring to keep within the boundaries of their sprawling temple cities and ziggurats. It was surprising then, to come upon this wreckage. Further up, beyond the foreboding stairs leading into Zul''Drak, Drak''Tharon Keep lies in ruin. The entire first tier of Zul''Drak, destroyed...$B$BWhy has the Scourge waited until now to attack?' WHERE `entry` = 12542;
